function deleteEnvironment(){const n=$("#databaseGroupId").val();Swal.fire({title:"Emin misiniz?",text:"Bu kayıt kalıcı olarak silinecektir!",icon:"warning",showCancelButton:!0,confirmButtonColor:"#c70039",cancelButtonColor:"#6c757d",confirmButtonText:"Sil",cancelButtonText:"Vazgeç"}).then(t=>{t.value&&$.ajax({dataType:"json",type:"POST",url:Urls.DeleteDatabaseGroup,data:{id:n},success:function(n){n.isSuccess===!0?redirectToWindowLocation(n.redirectUrl):n.message!==null?SweetAlertError(n.message):SweetAlertError()},error:function(n){console.log(n);SweetAlertError()}})})}function redirectToWindowLocation(n){window.location.href=n}function SweetAlertError(){Swal.fire("İşlem başarısız!","Bir hata oluştu. Lütfen daha sonra tekrar deneyiniz.","warning")}function SweetAlertError(n){Swal.fire("İşlem başarısız!",n,"warning")}$("#deleteDatabaseGroup").on("click",()=>{deleteEnvironment()});const databaseGroupName=$("#databaseGroupName").val();$("#favourite").on("click",()=>{var n=window.location.href;addFavourite(databaseGroupName,n)});